                if(this.data[j].municipio.nombre == this.municipios[index].municipio){
                    var numero = 0
                    numero = this.data[j].muertos + numero
                    numero = this.data[j].heridos + numero
                    numero = this.data[j].desaparecidos + numero
                    numero = this.data[j].personas + numero
                    numero = this.data[j].familias + numero
